import React from "react";
import { SmileCoordinates } from "./types";

interface Props {
  image?: string;
  coords?: SmileCoordinates[];
}

const SmileViewer: React.FC<Props> = ({ image, coords }) => (
  <div className="card" style={{ maxWidth: "350px", margin: "0 auto" }}>
    <div className="card-body">
      {image ? (
        <img
          src={image}
          alt="Detected Smile"
          className="img-fluid mb-3"
          style={{ maxWidth: "300px", display: "block", margin: "0 auto" }}
        />
      ) : (
        <p className="text-center">No Image Available</p>
      )}
      <h5 className="card-title">Smile Coordinates</h5>
      <pre style={{ fontSize: "0.9rem" }}>
        {coords ? JSON.stringify(coords, null, 2) : "No smile detected"}
      </pre>
    </div>
  </div>
);

export default SmileViewer;
